import React, { PureComponent } from "react";


class ImageBlock extends PureComponent{

    render() {
        let props=this.props;
        return (
            <div style={{width:"100%",margin:"5px auto"}}>
                <img src={props.src}/>
            </div> 
        );
    }
}

export default ImageBlock
